import React from "react";
import { Link } from "react-router-dom";
import classes from "";

const Navbar = () => {
  return (
    <nav className={classes}>
      <Link to={"/custom-table"}> Clear table</Link>
      <Link to={"/random-table"}> Random table</Link>
    </nav>
  );
};

export default Navbar;
